Getting Cozy (WebDl / 2015)

Recently single Marisa (Allie Haze) is unwillingly sent on a blind date by her best friend (AJ Applegate). Her date Brian (Michael Vegas) is definitely not her type. After a few cocktails though, things get out of hand and Marisa wakes up in his bed. She tries to make her escape but her walk of shame is foiled when she discovers there has been an overnight ice storm. Now Marisa and Brian are stuck together in his apartment over a holiday weekend. With nothing else to do but get to know one another, they both learn that sometimes first impressions are quite wrong.

AJ Applegate, Allie Haze, Scarlet Red

Couples, Feature, Romance

